{{Infobox person | name = Aisling Bea | image = Wikimania 2014 MMB 38 Aisling Bea.jpg | caption = Bea on stage during the [[Wikimania]] 2014 | birth_name = {{nowrap|Aisling Cliodhnadh O'Sullivan}} | birth_date = {{birth date and age|df=y|1984|3|16}} | birth_place = [[County Kildare]], Ireland | nationality = [[Irish nationality law|Irish]] | occupation = Actress, writer, comedian | years_active = 2002–present | website = {{official website|http://www.aislingbea.com/}} }} '''Aisling Bea''' ({{IPAc-en|ˈ|æ|ʃ|l|ɪ|ŋ}}; born '''Aisling Cliodhnadh O'Sullivan''', 16 March 1984) is an Irish actress, comedian and writer.
==Early life== Bea was born and raised in rural [[County Kildare]].<ref name=ideastap>{{cite web|url=http://www.ideastap.com/ideasmag/all-articles/Aisling-Bea-five-essentials|title=Five Essentials: Actor|accessdate=27 July 2012}}</ref><ref name=OfficialSite1/> Her father, Brian, was an equine [[Veterinary physician|vet]] who died suddenly when she was three years old.<ref name="tourists">{{cite news|title=In another life: Aisling Bea|url=https://www.thetimes.co.uk/article/my-job-was-to-teach-tourists-all-about-horse-sex-xdgdcqg33|accessdate=12 April 2018}}</ref> Bea and her younger sister, Sinéad,<ref name=Independent-Fringe-2015>{{cite news|last1=Jones|first1=Alice|title=Aisling Bea interview: The prize-winning comedian with the CV of a veteran on bringing her second stand-up show to the Fringe|url=https://www.independent.co.uk/arts-entertainment/edinburgh-festival/aisling-bea-interview-the-prizewinning-comedian-on-growing-up-on-a-stud-farm-juggling-three-careers-and-making-the-leap-into-standup-10452549.html|accessdate=18 August 2015|work=The Independent|date=12 August 2015}}</ref> were raised by their mother, Helen (''née'' Moloney), a secondary school teacher, jockey trainer<ref>http://www.edfestmag.com/20120815aislingbea/</ref> and former professional jockey.<ref>{{cite news|title=Insider Interrogation: writer and actor Aisling Bea - Independent.ie|url=https://www.independent.ie/entertainment/television/insider-interrogation-writer-and-actor-aisling-bea-30718799.html|accessdate=12 April 2018|work=Independent.ie|language=en}}</ref><ref name=IrishExaminer-Trollied-2014>{{cite news|last1=Fitzpatrick|first1=Richard|title=Funny woman, Aisling Bea, is of good stock|url=http://www.irishexaminer.com/lifestyle/artsfilmtv/funny-woman-aisling-bea-is-of-good-stock-275801.html|accessdate=18 August 2015|work=[[Irish Examiner]]|date=18 July 2014}}</ref> Her family were "obsessed" with horses and race meetings and, during her teenage years, Bea worked as a tour guide at the [[Irish National Stud]].<ref name="tourists"/> However, she knew from a young age that she was not interested in the racing industry "as a career" and instead enjoyed performing.<ref name="tourists"/>
Her grandfather was the [[Irish language]] [[novelist]] and [[poet]] [[Mícheál Ó Súilleabháin (writer)|Mícheál Ó Súilleabháin]]; her great-aunt was the [[playwright]] [[Siobhán Ní Shúilleabháin]].<ref>{{cite news|title=From horses to hilarity|url=http://www.advertiser.ie/galway/article/64322/from-horses-to-hilarity|accessdate=11 April 2018|work=Galway Advertiser}}</ref> Musician [[Liam O'Flynn]] was a family friend.<ref>{{cite tweet|user=WeeMissBea|title=Aisling Bea|number=973958399791542273|date=15 Mar 2018}}</ref>
When Bea was thirteen, her mother revealed that her father had died by [[suicide]].<ref name="The Guardian">{{cite web|title=My father's death has given me a love of men, of their vulnerability and tenderness|url=https://www.theguardian.com/lifeandstyle/2017/nov/04/aisling-bea-my-fathers-death-has-given-me-a-love-of-men-of-their-vulnerability-and-tenderness}}</ref> She adopted the stage name ‘Bea’ as a tribute to her father<ref name="Fitzpatrick">{{cite web|last1=Fitzpatrick|first1=Richard|title=Funny woman, Aisling Bea, is of good stock|url=https://www.irishexaminer.com/lifestyle/artsfilmtv/funny-woman-aisling-bea-is-of-good-stock-275801.html|website=Irish Examiner|accessdate=15 April 2018|date=18 July 2014}}</ref><ref name=Independent-Fringe-2015/> and wrote an article for ''[[The Guardian]]'' in 2017 about her family's experience of suicide.<ref>{{Cite news|url=https://amp.theguardian.com/lifeandstyle/2017/nov/04/aisling-bea-my-fathers-death-has-given-me-a-love-of-men-of-their-vulnerability-and-tenderness?CMP=Share_iOSApp_Other&__twitter_impression=true|title=Aisling Bea: ‘My father’s death has given me a love of men, of their vulnerability and tenderness’|date=2017-11-04|work=the Guardian|accessdate=5 January 2018}}</ref>
Bea was educated at a [[Catholic]] [[convent school]]<ref name="3careers"/> and then studied French and [[philosophy]] at [[Trinity College Dublin]].<ref name=OfficialSite1>{{cite web|title=Aisling Bea Official Site |url=http://www.aislingbea.com/about.php |publisher= |website=AislingBea.com |accessdate=15 January 2014 |deadurl=yes |archiveurl=https://web.archive.org/web/20140116134632/http://www.aislingbea.com/about.php |archivedate=16 January 2014 }}</ref><ref name="IrishmanAbroad">{{cite podcast|authorlink=Jarlath Regan |author=Jarlath Regan|edition=105|work=[[An Irishman Abroad]]|title=Aisling Bea|publisher=[[SoundCloud]]|date=19 September 2015|url=https://soundcloud.com/an-irishman-abroad/aisling-bea-episode-105|accessdate=22 September 2015}}</ref><ref name="3careers">{{cite news|title=Prize-winning comedian Aisling Bea on making the leap into stand-up|url=https://www.independent.co.uk/arts-entertainment/edinburgh-festival/aisling-bea-interview-the-prize-winning-comedian-on-growing-up-on-a-stud-farm-juggling-three-careers-10452549.html|accessdate=11 April 2018|work=The Independent|date=12 August 2015}}</ref> She was part of a student sketch comedy group<ref>{{cite web|title=Interviews - Development & Alumni|url=https://www.tcd.ie/alumni/alumni/interviews/aisling-bea.php|accessdate=15 April 2018}}</ref> and moved to London after graduation to study acting. In 2008, she completed a two-year course at the [[London Academy of Music and Dramatic Art]] (LAMDA).<ref>{{cite news|title=The buzz about funny girl Aisling Bea|url=http://www.dailymail.co.uk/home/you/article-5229381/The-buzz-funny-girl-Aisling-Bea.html|accessdate=12 April 2018|work=Mail Online}}</ref>
==Career== [[Image:MK17450 Aisling Bea.jpg|thumb|right|Bea on stage]] After drama school, Bea spent two years trying to get work in theatre as a dramatic actress.<ref>https://soundcloud.com/uclsound/humour-me-aisling-bea</ref> Instead, she found she was cast mainly in comedic television series including ''[[Cardinal Burns]]'' and ''[[Dead Boss]]'' (both 2012).<ref name="Gannon">{{cite web|last1=Gannon|first1=Louise|title=The buzz about funny girl Aisling Bea|url=http://www.dailymail.co.uk/home/you/article-5229381/The-buzz-funny-girl-Aisling-Bea.html|website=Mail Online|accessdate=15 April 2018}}</ref><ref name="Jones">{{cite web|last1=Jones|first1=Alice|title=Prize-winning comedian Aisling Bea on making the leap into stand-up|url=https://www.independent.co.uk/arts-entertainment/edinburgh-festival/aisling-bea-interview-the-prize-winning-comedian-on-growing-up-on-a-stud-farm-juggling-three-careers-10452549.html|website=The Independent|accessdate=15 April 2018|date=12 August 2015}}</ref> While filming ''Dead Boss'' in 2011, Bea decided to try stand-up comedy.<ref name="3careers"/><ref name="Biography">{{cite web|title=Biography.... WHO IS THIS BROAD?|url=http://www.aislingbea.com/biography/|website=www.aislingbea.com|accessdate=15 April 2018|language=en}}</ref> In 2012, she won the [[The Gilded Balloon|Gilded Balloon]] [[So You Think You're Funny]] award at the [[Edinburgh Festival Fringe]]<ref name=BBC1>{{cite news|url=https://www.bbc.co.uk/news/uk-scotland-19366992|title=Aisling Bea wins So You Think You're Funny|accessdate=24 August 2012|publisher=|work=BBC News|date=24 August 2012}}</ref> and, in 2013, was nominated for Best Newcomer at the [[Edinburgh Comedy Awards]] for her show ''C'est La Bea''.<ref>{{cite web|last=Duffy|first=Claire|title=Aisling Bea is nominated for Edinburgh Fringe Best Newcomer Award|url=http://entertainment.ie/comedy/feature/Aisling-Bea-is-nominated-for-Edinburgh-Fringe-Best-Newcomer-Award/209/4708.htm|publisher=Entertainment.ie|accessdate=15 January 2014}}</ref>
The exposure brought by these awards marked a "turning point" in Bea's career<ref name="theguardian.com">{{cite news|last1=Parkinson|first1=Hannah Jane|title=Aisling Bea: ‘I am making no money in LA, but creatively it is rewarding’|url=https://www.theguardian.com/tv-and-radio/2016/sep/18/aisling-bea-interview-the-fall-jamie-dornan|accessdate=15 April 2018|work=the Guardian|date=18 September 2016|language=en}}</ref> and she began to appear as a regular guest on panel shows including ''[[QI]]'', ''[[Insert Name Here]]'' and ''[[The Big Fat Quiz of the Year]]''.<ref>{{cite news|title=Interview: Rarely Asked Questions – Aisling Bea|url=https://www.beyondthejoke.co.uk/content/1613/interview-rarely-asked-questions-aisling-bea|accessdate=12 April 2018|work=Beyond The Joke|date=19 April 2015|language=en}}</ref> Bea and [[Yasmine Akram]] co-wrote and co-hosted the [[BBC Radio 4]] comedy folkflore series ''Micks and Legends'' (2012, 2015);<ref>{{cite news|title=Comedy Irish Micks and Legends back on BBC Radio 4|url=https://www.rte.ie/entertainment/2015/0121/674618-irish-micks-and-legends/|accessdate=15 April 2018|work=RTE.ie|date=21 January 2015|language=en}}</ref> it was nominated for a [[Chortle Awards|Chortle Award]] in 2013.<ref>http://www.radiolistings.co.uk/programmes/i/ir/irish_micks_and_legends.html</ref> Bea won the 2014 [[British Comedy Awards|British Comedy Award]] for Best Female TV Comic and returned to Edinburgh in 2015 with the live show ''Plan Bea''. In 2016, she became a team captain on ''[[8 Out of 10 Cats]]'' and was a cast member on ''[[Taskmaster (TV series)|Taskmaster]]'' in 2017.
Bea has continued to act in television sitcoms including ''[[Trollied]]'' (2014-2015) and ''[[The Delivery Man (TV series)|The Delivery Man]]'' (2015), and the crime dramas ''[[The Fall (TV series)|The Fall]]'' (2016) and ''[[Hard Sun]]'' (2018). In 2018, she and [[Sara Pascoe]] began to co-host the [[BBC Radio 2]] comedy chat show ''What's Normal?''.<ref>https://www.comedy.co.uk/radio/news/3037/sara_and_aisling_whats_normal/</ref> She has recorded a 15 minute stand-up special to be aired on [[Netflix]] in late 2018.
== Personal life == Bea is a vocal supporter of the [[Thirty-sixth Amendment of the Constitution Bill 2018 (Ireland)|Repeal the 8th]] campaign to introduce legal abortion in Ireland,<ref name="theguardian.com"/><ref>{{cite news|title=Standup for Choice - Repeal Eight|url=https://www.repealeight.ie/event/standup-for-choice/|accessdate=15 April 2018|work=Repeal Eight}}</ref> and contributed an essay to [[Una Mullally]]'s ''Repeal the 8th'' in 2018.<ref>{{cite news|title=Autonomy edited by Kathy D’Arcy, Repeal the 8th edited by Una Mullally review|url=https://www.irishtimes.com/culture/books/autonomy-edited-by-kathy-d-arcy-repeal-the-8th-edited-by-una-mullally-review-1.3444320|accessdate=15 April 2018|work=The Irish Times}}</ref> She previously campaigned for [[Same-sex marriage in the Republic of Ireland|same-sex marriage legislation]] in the successful 2015 Irish referendum.<ref name="theguardian.com"/>
